import './StyleHeader.css';
import React from 'react';

const CssText = ()=>{
    return <iframe className='header'>
        srcDoc={`<!DOCTYPE html>
          <html>
          <head>
            <title>Фрейм з текстом</title>
          </head>
          </html>`}
    </iframe>
}

export default CssText;
